    false,nt"url": null,nt"notes": "The all returns ASCII files contain the
    X,Y,Z values of all the LiDAR returns collected during the survey mission. In addition
    each return also has a time stamp, return number, ellipsoidal height and scan angle.
    The elevation values are in feet. TerraPoint surveyed and created this data for
    the Puget Sound LiDAR Consortium under contract. This data set covers 120 square
    miles. The LAS files were derived from all returns ASCII files contain the X,Y,Z
    values of all the LiDAR returns collected during the survey mission. The standard
    GPS time, scan angle, and return numbers of each point were preserved in the conversion
    from ASCII to LAS. The LAS files were classified by the NOAA CSC using an unsupervised
    algorithm. No warranty is made as to the accuracy of the classification. Futher
    details are available in the Process Steps below.",nt"license_title": null,nt"extras":
